import Card from 'react-bootstrap/Card';
import {Row, Col} from 'react-bootstrap'

function MyCard({data}) {
  return (<>
     <Row xs ={1} sm ={2} md ={3} lg ={4} className= 'g-4'>
     ( <Col>
        <Card
          className='card-design'
        > {data.map ((v, i)=> {return (
            <></>

        )})}
          
        </Card> </Col>
       </Row>
    </>
  );
}

export default MyCard;
